def _intarr():
 return list(map(int, sys.stdin.readline().split()))

def _str():
 return sys.stdin.readline()

def _strarr():
 return sys.stdin.readline().split()

def adj(a, b, c):
 if b != opp[a] and b != opp[c] and a != opp[c]:
  return True
 return False

